import React, { useState } from 'react';
import './Card.css';

export default function Leaderboard(props) {
  
  const firstPlace = props.firstPlace;
  return (
    <div>
      <table>
        {firstPlace}
        <tr className="colloumns">
          <th className="colloumns">
            Names
            {props.leaderboard.map((val, index) => {
              return <p key={index}>{val.name}</p>;
            })}
          </th>

          <th className="colloumns">
            Wins
            {props.leaderboard.map((val, index) => {
              return <p key={index}>{val.wins}</p>;
            })}
          </th>

          <th className="colloumns">
            Loses
            {props.leaderboard.map((val, index) => {
              return <p key={index}>{val.loses}</p>;
            })}
          </th>

          <th className="leftColloumn">
            Ties
            {props.leaderboard.map((val, index) => {
              return <p key={index}>{val.tie}</p>;
            })}
          </th>
        </tr>
      </table>
    </div>
  );
}
